import React from "react";
import "../Components/style/templates.css";
import "bootstrap/dist/css/bootstrap.min.css";


function Templates() {
  return (
    <div className="container-fluid">
      <div className="jumbotron jumbotron-fluid" id="bcgTemp">
      <div className="container-fluid" className="temp1">
        <h1 className="tempTitle">Starting points for your business.</h1>
        <p className="text1">
          Get started with any of our best-in-class website templates and, whether it's contact forms or color
          palettes. Making a beautiful website has never been faster.
        </p>
      </div>
      </div>
    </div>
  );
}

export default Templates;
